import React from "react"


class Users extends React.Component {
 users = [
    {
        id: 1,
        firstname: 'Bob',
        lastname: 'Marley',
        bio: 'lorem ipsum dolor sit amet consecteur',
        age: 40,
        isHappt: true
    },
    {
        id: 2,
        firstname: 'John',
        lastname: 'Doe',
        bio: 'lorem ipsum dolor sit amet consecteur',
        age: 22,
        isHappy: false
    }
 ]
 
 render() {
    if (this)
    return(<div>
        {this.users.map((el) => (<div className="user" key={el.id}>
            <h3>{el.firstname} {el.lastname}</h3>
            <p>{el.bio}</p>
        </div>))}
    </div>)
  }
}

export default Users
